import React from "react"

const Categories = () => {
    const data = [
        {
        cateImg:"./images/category/cat1.png",
        cateName:"Fashion"
        },
    ]
    return (
        <>
            <div className="category">
                {
                    data.map((value,index) => {
                        return(
                            <div className="box f_flex" key={index}>
                                
                            </div>
                        )
                    })
                }
            </div>
        </>
    )
}

export default Categories
